import React from 'react';

const VideoDetail = ({ selectedVideo }) => {
   // Outputs loading if there is no video selected.
   if(!selectedVideo) {
      return null;
   }

   return (
      <div>
         <div className="ui embed">
            <iframe src={``} />

            <iframe width="560" height="315" src={`https://www.youtube.com/embed/hWlYEaxubRY`} title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
         </div>
         <div className="ui segment">
            <h4 className="ui header">{selectedVideo.snippet.title}</h4>
            <p>{selectedVideo.snippet.description}</p>
         </div>
      </div>
   );
}

export default VideoDetail;
